@testset "5.5.1 u (a+b arcsec(c x))^n" begin
    (a, b, c, d, e, f, m, x, ) = @variables a b c d e f m x

    #= ::Package:: =#

    #= ::Title:: =#
    #=Integrands*of*the*form*u*(a+b*asec(c*x))^n=#


    #= ::Section::Closed:: =#
    #=Integrands*of*the*form*(d*x)^m*(a+b*asec(c*x))^n=#


    #= ::Subsection::Closed:: =#
    #=Integrands*of*the*form*x^m*(a+b*asec(c*x))^n=#


    #= ::Subsubsection::Closed:: =#
    #=n>0=#


    @test_int [x^6*(a + b*asec(c*x)), x, 7, -((5*b*sqrt(1 - 1/(c^2*x^2))*x^2)/(112*c^5)) - (5*b*sqrt(1 - 1/(c^2*x^2))*x^4)/(168*c^3) - (b*sqrt(1 - 1/(c^2*x^2))*x^6)/(42*c) + (1/7)*x^7*(a + b*asec(c*x)) - (5*b*atanh(sqrt(1 - 1/(c^2*x^2))))/(112*c^7)]
    @test_int [x^5*(a + b*asec(c*x)), x, 4, -((4*b*sqrt(1 - 1/(c^2*x^2))*x)/(45*c^5)) - (2*b*sqrt(1 - 1/(c^2*x^2))*x^3)/(45*c^3) - (b*sqrt(1 - 1/(c^2*x^2))*x^5)/(30*c) + (1/6)*x^6*(a + b*asec(c*x))]
    @test_int [x^4*(a + b*asec(c*x)), x, 6, -((3*b*sqrt(1 - 1/(c^2*x^2))*x^2)/(40*c^3)) - (b*sqrt(1 - 1/(c^2*x^2))*x^4)/(20*c) + (1/5)*x^5*(a + b*asec(c*x)) - (3*b*atanh(sqrt(1 - 1/(c^2*x^2))))/(40*c^5)]
    @test_int [x^3*(a + b*asec(c*x)), x, 3, -((b*sqrt(1 - 1/(c^2*x^2))*x)/(6*c^3)) - (b*sqrt(1 - 1/(c^2*x^2))*x^3)/(12*c) + (1/4)*x^4*(a + b*asec(c*x))]
    @test_int [x^2*(a + b*asec(c*x)), x, 5, -((b*sqrt(1 - 1/(c^2*x^2))*x^2)/(6*c)) + (1/3)*x^3*(a + b*asec(c*x)) - (b*atanh(sqrt(1 - 1/(c^2*x^2))))/(6*c^3)]
    @test_int [x^1*(a + b*asec(c*x)), x, 2, -((b*sqrt(1 - 1/(c^2*x^2))*x)/(2*c)) + (1/2)*x^2*(a + b*asec(c*x))]
    @test_int [x^0*(a + b*asec(c*x)), x, 5, a*x + b*x*asec(c*x) - (b*atanh(sqrt(1 - 1/(c^2*x^2))))/c]
    @test_int [(a + b*asec(c*x))/x^1, x, 6, (im*(a + b*asec(c*x))^2)/(2*b) - (a + b*asec(c*x))*log(1 + ℯ^(2*im*asec(c*x))) + (1/2)*im*b*PolyLog(2, -ℯ^(2*im*asec(c*x)))]
    @test_int [(a + b*asec(c*x))/x^2, x, 2, b*c*sqrt(1 - 1/(c^2*x^2)) - (a + b*asec(c*x))/x]
    @test_int [(a + b*asec(c*x))/x^3, x, 4, (b*c*sqrt(1 - 1/(c^2*x^2)))/(4*x) - (a + b*asec(c*x))/(2*x^2) - (1/4)*b*c^2*acsc(c*x)]
    @test_int [(a + b*asec(c*x))/x^4, x, 4, (1/3)*b*c^3*sqrt(1 - 1/(c^2*x^2)) - (1/9)*b*c^3*(1 - 1/(c^2*x^2))^(3/2) - (a + b*asec(c*x))/(3*x^3)]
    @test_int [(a + b*asec(c*x))/x^5, x, 5, (b*c*sqrt(1 - 1/(c^2*x^2)))/(16*x^3) + (3*b*c^3*sqrt(1 - 1/(c^2*x^2)))/(32*x) - (a + b*asec(c*x))/(4*x^4) - (3/32)*b*c^4*acsc(c*x)]
    @test_int [(a + b*asec(c*x))/x^6, x, 4, (1/5)*b*c^5*sqrt(1 - 1/(c^2*x^2)) - (2/15)*b*c^5*(1 - 1/(c^2*x^2))^(3/2) + (1/25)*b*c^5*(1 - 1/(c^2*x^2))^(5/2) - (a + b*asec(c*x))/(5*x^5)]
    @test_int [(a + b*asec(c*x))/x^7, x, 6, (b*c*sqrt(1 - 1/(c^2*x^2)))/(36*x^5) + (5*b*c^3*sqrt(1 - 1/(c^2*x^2)))/(144*x^3) + (5*b*c^5*sqrt(1 - 1/(c^2*x^2)))/(96*x) - (a + b*asec(c*x))/(6*x^6) - (5/96)*b*c^6*acsc(c*x)]


    @test_int [x^3*(a + b*asec(c*x))^2, x, 5, (b^2*x^2)/(12*c^2) - (b*sqrt(1 - 1/(c^2*x^2))*x*(a + b*asec(c*x)))/(3*c^3) - (b*sqrt(1 - 1/(c^2*x^2))*x^3*(a + b*asec(c*x)))/(6*c) + (1/4)*x^4*(a + b*asec(c*x))^2 + (b^2*log(x))/(3*c^4)]
    @test_int [x^2*(a + b*asec(c*x))^2, x, 8, (b^2*x)/(3*c^2) - (b*sqrt(1 - 1/(c^2*x^2))*x^2*(a + b*asec(c*x)))/(3*c) + (1/3)*x^3*(a + b*asec(c*x))^2 + (2*im*b*(a + b*asec(c*x))*atan(ℯ^(im*asec(c*x))))/(3*c^3) - (im*b^2*PolyLog(2, (-im)*ℯ^(im*asec(c*x))))/(3*c^3) + (im*b^2*PolyLog(2, im*ℯ^(im*asec(c*x))))/(3*c^3)]
    @test_int [x^1*(a + b*asec(c*x))^2, x, 4, -((b*sqrt(1 - 1/(c^2*x^2))*x*(a + b*asec(c*x)))/c) + (1/2)*x^2*(a + b*asec(c*x))^2 + (b^2*log(x))/c^2]
    @test_int [x^0*(a + b*asec(c*x))^2, x, 7, x*(a + b*asec(c*x))^2 + (4*im*b*(a + b*asec(c*x))*atan(ℯ^(im*asec(c*x))))/c - (2*im*b^2*PolyLog(2, (-im)*ℯ^(im*asec(c*x))))/c + (2*im*b^2*PolyLog(2, im*ℯ^(im*asec(c*x))))/c]
    @test_int [(a + b*asec(c*x))^2/x^1, x, 6, (im*(a + b*asec(c*x))^3)/(3*b) - (a + b*asec(c*x))^2*log(1 + ℯ^(2*im*asec(c*x))) + im*b*(a + b*asec(c*x))*PolyLog(2, -ℯ^(2*im*asec(c*x))) - (1/2)*b^2*PolyLog(3, -ℯ^(2*im*asec(c*x)))]
    @test_int [(a + b*asec(c*x))^2/x^2, x, 4, (2*b^2)/x + 2*b*c*sqrt(1 - 1/(c^2*x^2))*(a + b*asec(c*x)) - (a + b*asec(c*x))^2/x]
    @test_int [(a + b*asec(c*x))^2/x^3, x, 4, b^2/(4*x^2) - (1/2)*a*b*c^2*asec(c*x) - (1/4)*b^2*c^2*asec(c*x)^2 + (b*c*sqrt(1 - 1/(c^2*x^2))*(a + b*asec(c*x)))/(2*x) + (1/2)*(c^2 - 1/x^2)*(a + b*asec(c*x))^2]
    @test_int [(a + b*asec(c*x))^2/x^4, x, 5, (2*b^2)/(27*x^3) + (4*b^2*c^2)/(9*x) + (4/9)*b*c^3*sqrt(1 - 1/(c^2*x^2))*(a + b*asec(c*x)) + (2*b*c*sqrt(1 - 1/(c^2*x^2))*(a + b*asec(c*x)))/(9*x^2) - (a + b*asec(c*x))^2/(3*x^3)]
    @test_int [(a + b*asec(c*x))^2/x^5, x, 5, b^2/(32*x^4) + (3*b^2*c^2)/(32*x^2) + (3/16)*a*b*c^4*asec(c*x) + (3/32)*b^2*c^4*asec(c*x)^2 + (b*c*sqrt(1 - 1/(c^2*x^2))*(a + b*asec(c*x)))/(8*x^3) + (3*b*c^3*sqrt(1 - 1/(c^2*x^2))*(a + b*asec(c*x)))/(16*x) - (a + b*asec(c*x))^2/(4*x^4)]


    @test_int [x^3*(a + b*asec(c*x))^3, x, 10, -((b^3*sqrt(1 - 1/(c^2*x^2))*x)/(4*c^3)) + (b^2*x^2*(a + b*asec(c*x)))/(4*c^2) + (im*b*(a + b*asec(c*x))^2)/(2*c^4) - (b*sqrt(1 - 1/(c^2*x^2))*x*(a + b*asec(c*x))^2)/(2*c^3) - (b*sqrt(1 - 1/(c^2*x^2))*x^3*(a + b*asec(c*x))^2)/(4*c) + (1/4)*x^4*(a + b*asec(c*x))^3 - (b^2*(a + b*asec(c*x))*log(1 + ℯ^(2*im*asec(c*x))))/c^4 + (im*b^3*PolyLog(2, -ℯ^(2*im*asec(c*x))))/(2*c^4)]
    @test_int [x^2*(a + b*asec(c*x))^3, x, 11, (b^2*x*(a + b*asec(c*x)))/c^2 - (b*sqrt(1 - 1/(c^2*x^2))*x^2*(a + b*asec(c*x))^2)/(2*c) + (1/3)*x^3*(a + b*asec(c*x))^3 + (im*b*(a + b*asec(c*x))^2*atan(ℯ^(im*asec(c*x))))/c^3 - (b^3*atanh(sqrt(1 - 1/(c^2*x^2))))/c^3 - (im*b^2*(a + b*asec(c*x))*PolyLog(2, (-im)*ℯ^(im*asec(c*x))))/c^3 + (im*b^2*(a + b*asec(c*x))*PolyLog(2, im*ℯ^(im*asec(c*x))))/c^3 + (b^3*PolyLog(3, (-im)*ℯ^(im*asec(c*x))))/c^3 - (b^3*PolyLog(3, im*ℯ^(im*asec(c*x))))/c^3]
    @test_int [x^1*(a + b*asec(c*x))^3, x, 7, (3*im*b*(a + b*asec(c*x))^2)/(2*c^2) - (3*b*sqrt(1 - 1/(c^2*x^2))*x*(a + b*asec(c*x))^2)/(2*c) + (1/2)*x^2*(a + b*asec(c*x))^3 - (3*b^2*(a + b*asec(c*x))*log(1 + ℯ^(2*im*asec(c*x))))/c^2 + (3*im*b^3*PolyLog(2, -ℯ^(2*im*asec(c*x))))/(2*c^2)]
    @test_int [x^0*(a + b*asec(c*x))^3, x, 9, x*(a + b*asec(c*x))^3 + (6*im*b*(a + b*asec(c*x))^2*atan(ℯ^(im*asec(c*x))))/c - (6*im*b^2*(a + b*asec(c*x))*PolyLog(2, (-im)*ℯ^(im*asec(c*x))))/c + (6*im*b^2*(a + b*asec(c*x))*PolyLog(2, im*ℯ^(im*asec(c*x))))/c + (6*b^3*PolyLog(3, (-im)*ℯ^(im*asec(c*x))))/c - (6*b^3*PolyLog(3, im*ℯ^(im*asec(c*x))))/c]
    @test_int [(a + b*asec(c*x))^3/x^1, x, 7, (im*(a + b*asec(c*x))^4)/(4*b) - (a + b*asec(c*x))^3*log(1 + ℯ^(2*im*asec(c*x))) + (3/2)*im*b*(a + b*asec(c*x))^2*PolyLog(2, -ℯ^(2*im*asec(c*x))) - (3/2)*b^2*(a + b*asec(c*x))*PolyLog(3, -ℯ^(2*im*asec(c*x))) - (3/4)*im*b^3*PolyLog(4, -ℯ^(2*im*asec(c*x)))]
    @test_int [(a + b*asec(c*x))^3/x^2, x, 5, -6*b^3*c*sqrt(1 - 1/(c^2*x^2)) + (6*b^2*(a + b*asec(c*x)))/x + 3*b*c*sqrt(1 - 1/(c^2*x^2))*(a + b*asec(c*x))^2 - (a + b*asec(c*x))^3/x]
    @test_int [(a + b*asec(c*x))^3/x^3, x, 6, -((3*b^3*c*sqrt(1 - 1/(c^2*x^2)))/(8*x)) + (3/8)*b^3*c^2*asec(c*x) - (3/4)*b^2*(c^2 - 1/x^2)*(a + b*asec(c*x)) + (3*b*c*sqrt(1 - 1/(c^2*x^2))*(a + b*asec(c*x))^2)/(4*x) - (1/4)*c^2*(a + b*asec(c*x))^3 + (1/2)*(c^2 - 1/x^2)*(a + b*asec(c*x))^3]
    @test_int [(a + b*asec(c*x))^3/x^4, x, 8, (-(14/9))*b^3*c^3*sqrt(1 - 1/(c^2*x^2)) + (2/27)*b^3*c^3*(1 - 1/(c^2*x^2))^(3/2) + (2*b^2*(a + b*asec(c*x)))/(9*x^3) + (4*b^2*c^2*(a + b*asec(c*x)))/(3*x) + (2/3)*b*c^3*sqrt(1 - 1/(c^2*x^2))*(a + b*asec(c*x))^2 + (b*c*sqrt(1 - 1/(c^2*x^2))*(a + b*asec(c*x))^2)/(3*x^2) - (a + b*asec(c*x))^3/(3*x^3)]
    @test_int [(a + b*asec(c*x))^3/x^5, x, 10, -((3*b^3*c*sqrt(1 - 1/(c^2*x^2)))/(128*x^3)) - (45*b^3*c^3*sqrt(1 - 1/(c^2*x^2)))/(256*x) - (45/256)*b^3*c^4*asec(c*x) + (3*b^2*(a + b*asec(c*x)))/(32*x^4) + (9*b^2*c^2*(a + b*asec(c*x)))/(32*x^2) + (3*b*c*sqrt(1 - 1/(c^2*x^2))*(a + b*asec(c*x))^2)/(16*x^3) + (9*b*c^3*sqrt(1 - 1/(c^2*x^2))*(a + b*asec(c*x))^2)/(32*x) + (3/32)*c^4*(a + b*asec(c*x))^3 - (a + b*asec(c*x))^3/(4*x^4)]


    #= ::Subsubsection::Closed:: =#
    #=n<0=#


    @test_int [x^1/(a + b*asec(c*x)), x, 0, Unintegrable(x/(a + b*asec(c*x)), x)]
    @test_int [x^0/(a + b*asec(c*x)), x, 0, Unintegrable(1/(a + b*asec(c*x)), x)]
    @test_int [1/(x^1*(a + b*asec(c*x))), x, 0, Unintegrable(1/(x*(a + b*asec(c*x))), x)]
    @test_int [1/(x^2*(a + b*asec(c*x))), x, 4, -((c*CosIntegral(a/b + asec(c*x))*sin(a/b))/b) + (c*cos(a/b)*SinIntegral(a/b + asec(c*x)))/b]
    @test_int [1/(x^3*(a + b*asec(c*x))), x, 6, -((c^2*CosIntegral((2*a)/b + 2*asec(c*x))*sin((2*a)/b))/(2*b)) + (c^2*cos((2*a)/b)*SinIntegral((2*a)/b + 2*asec(c*x)))/(2*b)]
    @test_int [1/(x^4*(a + b*asec(c*x))), x, 9, -((c^3*CosIntegral(a/b + asec(c*x))*sin(a/b))/(4*b)) - (c^3*CosIntegral((3*a)/b + 3*asec(c*x))*sin((3*a)/b))/(4*b) + (c^3*cos(a/b)*SinIntegral(a/b + asec(c*x)))/(4*b) + (c^3*cos((3*a)/b)*SinIntegral((3*a)/b + 3*asec(c*x)))/(4*b)]


    @test_int [x^1/(a + b*asec(c*x))^2, x, 0, Unintegrable(x/(a + b*asec(c*x))^2, x)]
    @test_int [x^0/(a + b*asec(c*x))^2, x, 0, Unintegrable(1/(a + b*asec(c*x))^2, x)]
    @test_int [1/(x^1*(a + b*asec(c*x))^2), x, 0, Unintegrable(1/(x*(a + b*asec(c*x))^2), x)]
    @test_int [1/(x^2*(a + b*asec(c*x))^2), x, 5, -((c*sqrt(1 - 1/(c^2*x^2)))/(b*(a + b*asec(c*x)))) + (c*cos(a/b)*CosIntegral(a/b + asec(c*x)))/b^2 + (c*sin(a/b)*SinIntegral(a/b + asec(c*x)))/b^2]
    @test_int [1/(x^3*(a + b*asec(c*x))^2), x, 7, (c^2*cos((2*a)/b)*CosIntegral((2*a)/b + 2*asec(c*x)))/b^2 - (c^2*sin(2*asec(c*x)))/(2*b*(a + b*asec(c*x))) + (c^2*sin((2*a)/b)*SinIntegral((2*a)/b + 2*asec(c*x)))/b^2]
    @test_int [1/(x^4*(a + b*asec(c*x))^2), x, 11, -((c^3*sqrt(1 - 1/(c^2*x^2)))/(4*b*(a + b*asec(c*x)))) + (c^3*cos(a/b)*CosIntegral(a/b + asec(c*x)))/(4*b^2) + (3*c^3*cos((3*a)/b)*CosIntegral((3*a)/b + 3*asec(c*x)))/(4*b^2) - (c^3*sin(3*asec(c*x)))/(4*b*(a + b*asec(c*x))) + (c^3*sin(a/b)*SinIntegral(a/b + asec(c*x)))/(4*b^2) + (3*c^3*sin((3*a)/b)*SinIntegral((3*a)/b + 3*asec(c*x)))/(4*b^2)]


    @test_int [x^1/(a + b*asec(c*x))^3, x, 0, Unintegrable(x/(a + b*asec(c*x))^3, x)]
    @test_int [x^0/(a + b*asec(c*x))^3, x, 0, Unintegrable(1/(a + b*asec(c*x))^3, x)]
    @test_int [1/(x^1*(a + b*asec(c*x))^3), x, 0, Unintegrable(1/(x*(a + b*asec(c*x))^3), x)]
    @test_int [1/(x^2*(a + b*asec(c*x))^3), x, 6, -((c*sqrt(1 - 1/(c^2*x^2)))/(2*b*(a + b*asec(c*x))^2)) - 1/(2*b^2*x*(a + b*asec(c*x))) + (c*CosIntegral(a/b + asec(c*x))*sin(a/b))/(2*b^3) - (c*cos(a/b)*SinIntegral(a/b + asec(c*x)))/(2*b^3)]
    @test_int [1/(x^3*(a + b*asec(c*x))^3), x, 8, -((c^2*cos(2*asec(c*x)))/(2*b^2*(a + b*asec(c*x)))) + (c^2*CosIntegral((2*a)/b + 2*asec(c*x))*sin((2*a)/b))/b^3 - (c^2*sin(2*asec(c*x)))/(4*b*(a + b*asec(c*x))^2) - (c^2*cos((2*a)/b)*SinIntegral((2*a)/b + 2*asec(c*x)))/b^3]
    @test_int [1/(x^4*(a + b*asec(c*x))^3), x, 13, -((c^3*sqrt(1 - 1/(c^2*x^2)))/(8*b*(a + b*asec(c*x))^2)) - c^2/(8*b^2*x*(a + b*asec(c*x))) - (3*c^3*cos(3*asec(c*x)))/(8*b^2*(a + b*asec(c*x))) + (c^3*CosIntegral(a/b + asec(c*x))*sin(a/b))/(8*b^3) + (9*c^3*CosIntegral((3*a)/b + 3*asec(c*x))*sin((3*a)/b))/(8*b^3) - (c^3*sin(3*asec(c*x)))/(8*b*(a + b*asec(c*x))^2) - (c^3*cos(a/b)*SinIntegral(a/b + asec(c*x)))/(8*b^3) - (9*c^3*cos((3*a)/b)*SinIntegral((3*a)/b + 3*asec(c*x)))/(8*b^3)]


    #= ::Subsection::Closed:: =#
    #=Integrands*of*the*form*(d*x)^m*(a+b*asec(c*x))^n*with*m*symbolic=#


