    @test_int [(d*x)^m*(a + b*asec(c*x))^2, x, 0, Unintegrable((d*x)^m*(a + b*asec(c*x))^2, x)]
    @test_int [(d*x)^m*(a + b*asec(c*x))^1, x, 3, ((d*x)^(1 + m)*(a + b*asec(c*x)))/(d*(1 + m)) - (b*(d*x)^m*HypergeometricFunctions._₂F₁(1/2, -(m/2), 1 - m/2, 1/(c^2*x^2)))/(c*m*(1 + m))]
    @test_int [(d*x)^m/(a + b*asec(c*x))^1, x, 0, Unintegrable((d*x)^m/(a + b*asec(c*x)), x)]
    @test_int [(d*x)^m/(a + b*asec(c*x))^2, x, 0, Unintegrable((d*x)^m/(a + b*asec(c*x))^2, x)]


